import React, { useState } from "react";
import "./LoginSignup.css";

function LoginSignup() {
  const [wraper, setWraper] = useState(false);
  function registerFunc() {
    setWraper(true);
    console.log("Register");
    // wraper.classList.add("wraper-new-height");
    // inputPage.forEach((input) => {
    //   input.classList.add("toggle-pages");
    // });
  }

  function loginFunc() {
    setWraper(false);
    // wraper.classList.remove("wraper-new-height");
    // inputPage.forEach((input) => {
    //   input.classList.remove("toggle-pages");
    // });
  }

  return (
    <div className="loginsignup">
      <div className="wraper">
        <div className="close-container">X</div>
        <div className="container">
          <div
            className={`input-page ${
              wraper ? "wraper-new-height toggle-pages " : ""
            }`}
          >
            <span>Login</span>
            <label htmlFor="email">
              <input type="email" required />
              <span className="material-symbols-outlined"> mail </span>
              <p> Email </p>
            </label>

            <label htmlFor="password">
              <input type="password" required />
              <span className="material-symbols-outlined"> lock </span>
              <p> Password </p>
            </label>
            <div className="forgot-remember">
              <p>
                <input type="checkbox" />
                Remember me
              </p>
              <a href="#">Forgot Password?</a>
            </div>
            <button className="log-reg-btn" type="submit">
              Login
            </button>
            <div className="register-login">
              <p>
                Don't have an account?
                <a onClick={registerFunc}>Register</a>
              </p>
            </div>
          </div>

          <div className="input-page">
            <span>Register</span>
            <label htmlFor="email">
              <input type="text" required />
              <span className="material-symbols-outlined"> person </span>
              <p> Username </p>
            </label>

            <label htmlFor="email">
              <input type="email" required />
              <span className="material-symbols-outlined"> mail </span>
              <p> Email </p>
            </label>

            <label htmlFor="password">
              <input type="password" required />
              <span className="material-symbols-outlined"> lock </span>
              <p> Password </p>
            </label>
            <div className="term-conditions">
              <p>
                <input type="checkbox" />I agree to the
              </p>
              <a href="#">terms & conditions</a>
            </div>
            <button className="log-reg-btn" type="submit">
              Register
            </button>
            <div className="register-login">
              <p>
                Already have an account?
                <a onClick={loginFunc}>Login</a>
              </p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default LoginSignup;

